import React from "react";
import './Home.css';

function Home() {
  return (
    <div className="intro-container">
      <div className="logo-container">
        <img src="/Chatbot.png" alt="Chatbot" className="intro-image" />
        <span className="mediconnect-name">Mediconnect</span>
      </div>
      <p className="intro-text">Connecting rural India with AI-powered telemedicine services.</p>
    </div>
  );
}

export default Home;
